import { Col, Card } from 'react-bootstrap'

import { Link } from 'react-router-dom'

function MobileCard(props) {

    return (

        <>
            <tr>
                <h3>{props.name}</h3>
                <td><img src={props.imageFileName}/> </td>
            </tr>

        </>

    )
}

export default MobileCard
